create table ingredients_0
(
    ingredient_id            int auto_increment                  primary key,
    name                     varchar(128)                        not null,
    category_id              int                                 null,
    carbon_foot_print        double                              null,
    carbon_foot_print_source varchar(50)                         null comment 'How the WFP value has been retrieved',
    carbon_foot_print_weight varchar(50)                         null comment 'The weight of ingredient corresponding to the given WFP',
    water_foot_print         double                              null,
    water_foot_print_source  varchar(50)                         null comment 'How the WFP value has been retrieved',
    water_foot_print_weight  varchar(50)                         null comment 'The weight of ingredient corresponding to the given WFP',
    kcal                     float                               null,
    kcal_weight              float                               null,
    protein                  float                               null,
    protein_weight           float                               null,
    fat                      float                               null,
    fat_weight               float                               null,
    carbohydrates            float                               null,
    carbohydrates_weight     float                               null,
    fiber                    float                               null,
    fiber_weight             float                               null,
    vendor_recipe_ids        longtext                            null comment 'A list of strings in format idx@recipe_vendor_id which help to assign an ingredient to a vendor recipe',
    created_at               timestamp default CURRENT_TIMESTAMP not null,
    updated_at               timestamp default CURRENT_TIMESTAMP not null on update CURRENT_TIMESTAMP,
    constraint ingredients_0_ibfk_1
        foreign key (category_id) references categories (category_id)
            on update cascade on delete cascade
);

create index category_id_0
    on ingredients_0 (category_id);

COMMIT;